import { useHistory } from "react-router-dom";
import IconButton from '@mui/material/IconButton';
import ArrowBackIcon from '@mui/icons-material/ArrowBack';
import ArrowForwardIcon from '@mui/icons-material/ArrowForward';
import './main.scss'
const Arrows = () => {
    const hexToRGB = (hex, alpha) => {
        var r = parseInt(hex.slice(1, 3), 16),
            g = parseInt(hex.slice(3, 5), 16),
            b = parseInt(hex.slice(5, 7), 16);

        if (alpha) {
            return "rgba(" + r + ", " + g + ", " + b + ", " + alpha + ")";
        } else {
            return "rgb(" + r + ", " + g + ", " + b + ")";
        }
    }
    const history = useHistory();
    return (
        <div style={{ position: 'fixed', right: '6vw' }}>
            <button onClick={() => alert(hexToRGB("#ffffff"))}>dd</button>
            <IconButton className="history-arrow-btn" color="primary" aria-label="upload picture" component="span" onClick={() => history.goBack()}>
                <ArrowBackIcon className={"history-arrow"} />
            </IconButton>
            <IconButton className="history-arrow-btn" color="primary" aria-label="upload picture" component="span" onClick={() => history.goForward()}>
                <ArrowForwardIcon className={"history-arrow"} />
            </IconButton>
        </div >
    );
}

export default Arrows;
